(1, '<p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0cm;text-align:center;\r\nmso-hyphenate:none\"><span style=\"font-family: Arial, sans-serif; text-align: justify; font-size: 1rem;\">Siendo\r\nlas 8:00 a.m., del 26 de enero del año 2022, en la ciudad de Bogotá D.C., se\r\ndeja constancia de la publicación de la Notificación por Aviso No. 01, a través\r\nde la cual se fijó la lista de los usuarios a quienes se solicitó presentarse\r\nen el parqueadero o comunicarse a través de correo electrónico, con el fin de\r\nllevar a cabo la conciliación y dar cierre a las reclamaciones interpuestas. Por\r\nlo tanto se advierte que se procederá a desfijar el presente aviso el día 26 de\r\nenero del año 2022 conforme a estipulado en el artículo 69 de la Ley 1437 de\r\n2011.</span><br></p>', '2022-01-27 09:50:00', 2, '2022-01-27 09:52:00', 2, 1);
