(10, 'Mauricio Lopez', 'mald21lodi@gmail.com', 'Buena tarde,\r\n\r\nSiendo las 8:20 am del día 25 de agosto de 2021 me parquee en una baia disponible para parqueo temporal en la carrera 82 a # 6b-30 y a las 8:34 evidencio que el carro esta siendo arrastrado (no sobre la grúa, donde ya iba un vehículo y el número autorizado de carga para esa grúa es de 2 vehículos, un ciclomotor y un automovil) y al alcanzarlo un comunicado verbal de la agente explicando que por mal parqueo y abandono de automóvil fue retenido mi vehiculo. Corri media cuadra que La grúa había adelantado cuando aborde a la agente Lida Castro con número de placa 187386 y al veedor Jorge Andres Pira Lemus Lemus con cc 1022.379.651 y carnet de contratista de la Secretaria distrital de movilidad a quienes les informo que no estaba ni mal parqueado ni en estado de abandono como según video lo demuestro con otros automóviles de la zona. Además de que en un lugar de parqueo temporal, como la misma agente y el veedor de tránsito me lo comunican, y que no sabían cuanto tiempo llevaba allí parqueado aún cuando mientras hacía el levantamiento del otro automóvil, que si estaba sobre la vía, ellos me vieron, esperaron la oportunidad y la llevaron a cabo, solo que muy mal. La agente se niega a mostrarme su identificación como servidora pública en un principio, por lo que debo grabar y solicitarle me permita ver además de su placa, el carnet que la identifica como funcionaria pública de la Policía Nacional de Tránsito y Transporte, nombres y número de agente y al cual se negó y no mostró. El veedor me muestra su carnet y le pido sean honestos y no actuar mal, más aún cuando el es nuestra voz frente a la irregularidad de la agente de tránsito. Arbitrariamente, llevan a cabo un indebido proceso tanto la agente como el veedor que se encontraba y los funcionarios de la grúa pues yo me encontraba presente y aun así decidieron seguir con el proceso de levantar el auto y cuando le solicité la copia de la orden de comparendo, ella se niega y a la media hora me la entrega o mejor me la \"lanza a la mano\" desde luego sin mi nombre y número de documento en la orden de comparendo y al estar allí presente debía adjudicar la supuesta infracción a nombre propio. Desde luego por el indebido proceso la orden de comparendo solo aparece con la placa del automóvil. El veedor en ningún momento hizo caso a mi reclamación y omitió cumplir con deber de veedor. \r\n\r\nElevo un derecho de peticion a fin que se inicie las actuaciones administrativas tendientes a iniciar una investigación a la orden de comparendo # 11001000000030503747 del día 25/08/2021 a las 8:34 am en el cual la grúa de placas JKV 647  carga el automóvil y de igual forma se inicie la respectiva investigación disciplinaria al señor Emiliano Torres Carvajal con cc 80068193 toda vez que  no cumplió a cabalidad en su manera de obrar como funcionario de g y p moviendo en reversa aceleradamente el automóvil de la baia con freno de mano y poderlo cargar sobre la vía, para luego pedirme, ya estando arrastrado que porfavor le quitara el freno de mano. Al colaborar y ser participe en llevar a cabo un indebido proceso teniendo en cuenta que el vehículo no se encontraba mal parqueado, ni en estado de abandono, ni obstaculizando una vía, ni existe una señal de tránsito sobre ese costado que prohíba el parqueo. \r\n\r\nAtento a la respuesta y radicado de este derecho de petición.\r\n\r\nCiudadano Colombiano\r\nMauricio Alberto López Díaz \r\nCc 80800787\r\nCel: 3108740860', '2021-08-25 16:12:27'),
