(16, 'Grua planchon moto 1', '../images/servicios/gruas/Grua_planchon_moto_1_20220126_2038.webp', '../images/servicios/gruas/Grua_planchon_moto_1_20220126_2038.png', '2021-09-24 18:34:00', 1, '2022-01-26 20:38:07', 4, 1, 4, 8, NULL, 1, 'Foto: GyP Bogotá S.A.S - Año: 2022', 7),
(17, 'grua planchon moto 2', '../images/servicios/gruas/grua_planchon_moto_2_20220126_2035.webp', '../images/servicios/gruas/grua_planchon_moto_2_20220126_2035.png', '2021-09-24 18:34:00', 1, '2022-01-26 20:35:30', 4, 1, 4, 8, NULL, 2, 'Foto: GyP Bogotá S.A.S - Año: 2022', 8),
(18, 'grua izaje lateral 1', '../images/servicios/gruas/grua_izaje_lateral_1_20220126_2048.webp', '../images/servicios/gruas/grua_izaje_lateral_1_20220126_2048.png', '2021-09-24 18:35:00', 1, '2022-01-26 20:48:10', 4, 1, 4, 8, NULL, 1, 'Foto: GyP Bogotá S.A.S - Año: 2022', 9),
(19, 'grua izaje lateral 2', '../images/servicios/gruas/grua_izaje_lateral_2_20220126_2050.webp', '../images/servicios/gruas/grua_izaje_lateral_2_20220126_2050.png', '2021-09-24 18:35:00', 1, '2022-01-26 20:50:25', 4, 1, 4, 8, NULL, 2, 'Foto: GyP Bogotá S.A.S - Año: 2022', 10),
(20, 'Proceso Inomvilizacion 1', '../images/servicios/proceso_inmovilizacion/Proceso_Inomvilizacion_1_20210924_1902.jpg', '../images/servicios/proceso_inmovilizacion/Proceso_Inomvilizacion_1_20210924_1902.webp', '2021-09-24 19:02:00', 1, '2022-01-26 13:49:39', 4, 2, 4, 11, '<p id=\"subTitleImage\"><font style=\"color:#879225;\">1.</font> La <font style=\"color:#879225;\">autoridad de tránsito</font> solicita la grúa desde el punto donde el ciudadano ha cometido la infracción a través de la plataforma tecnológica.</p>', 1, 'Foto: GyP Bogotá S.A.S - Año: 2021', 0),
(21, 'proceso inmovilizacion 2', '../images/servicios/proceso_inmovilizacion/proceso_inmovilizacion_2_20220126_1347.webp', '../images/servicios/proceso_inmovilizacion/proceso_inmovilizacion_2_20220126_1347.jpeg', '2021-09-24 19:04:00', 1, '2022-01-26 13:52:49', 4, 2, 4, 11, '<p id=\"subTitleImage\"><font style=\"color:#879225;\">2.</font> El sistema asigna el evento a la grúa más cercana demarcando la ruta ideal para ofrecer un servicio <font style=\"color:#879225;\">oportuno y rápido.</font></p>', 2, 'Foto: GyP Bogotá S.A.S - Año: 2022', 0),
(22, 'proceso inmovilizacion 3', '../images/servicios/proceso_inmovilizacion/proceso_inmovilizacion_3_20210924_1905.png', '../images/servicios/proceso_inmovilizacion/proceso_inmovilizacion_3_20210924_1905.webp', '2021-09-24 19:05:00', 1, '2022-01-26 13:47:42', 4, 2, 4, 11, '<p id=\"subTitleImage\"><font style=\"color:#879225;\">3.</font> Al llegar al punto de inmovilización, el operador de grúa <font style=\"color:#879225;\">registra en video</font> el estado del vehículo generando un inventario digital.</p>', 3, 'Foto: GyP Bogotá S.A.S - Año: 2021', 0),
(23, 'proceso inmovilizacion 4', '../images/servicios/proceso_inmovilizacion/proceso_inmovilizacion_4_20210924_1905.jpg', '../images/servicios/proceso_inmovilizacion/proceso_inmovilizacion_4_20210924_1905.webp', '2021-09-24 19:05:00', 1, '2022-01-26 13:48:02', 4, 2, 4, 11, '<p id=\"subTitleImage\"><font style=\"color:#879225;\">4. Se ubican los sellos</font> en las puertas, capó, baúl y en las motocicletas en la tapa del tanque de combustible.</p>', 4, 'Foto: GyP Bogotá S.A.S - Año: 2021', 0),
(24, 'proceso inmovilizacion 5', '../images/servicios/proceso_inmovilizacion/proceso_inmovilizacion_5_20210924_1906.jpg', '../images/servicios/proceso_inmovilizacion/proceso_inmovilizacion_5_20210924_1906.webp', '2021-09-24 19:06:00', 1, '2022-01-26 13:48:17', 4, 2, 4, 11, '<p id=\"subTitleImage\"><font style=\"color:#879225;\">5.</font> El vehículo se <font style=\"color:#879225;\">asegura correctamente</font> a la grúa y es trasladado al parqueadero autorizado.\r\n                    </p>', 5, 'Foto: GyP Bogotá S.A.S - Año: 2021', 0),
(25, 'proceso inmovilizacion 6', '../images/servicios/proceso_inmovilizacion/proceso_inmovilizacion_6_20210924_1906.jpg', '../images/servicios/proceso_inmovilizacion/proceso_inmovilizacion_6_20210924_1906.webp', '2021-09-24 19:06:00', 1, '2022-01-26 13:48:33', 4, 2, 4, 11, '<p id=\"subTitleImage\"><font style=\"color:#879225;\">6.</font> Cuando el vehículo llega al parqueadero, se realiza un <font style=\"color:#879225;\">nuevo registro</font> en video para verificar el estado en que llegó el automotor.</p>', 6, 'Foto: GyP Bogotá S.A.S - Año: 2021', 0),
(26, 'proceso inmovilizacion 7', '../images/servicios/proceso_inmovilizacion/proceso_inmovilizacion_7_20210924_1907.jpg', '../images/servicios/proceso_inmovilizacion/proceso_inmovilizacion_7_20210924_1907.webp', '2021-09-24 19:07:00', 1, '2022-01-26 13:48:52', 4, 2, 4, 11, '<p id=\"subTitleImage\"><font style=\"color:#879225;\">7.</font> El <font style=\"color:#879225;\">vehículo es ubicado</font> en el parqueadero según su tipología (motocicleta, livianos, mediamos o pesados).\r\n                    </p>', 7, 'Foto: GyP Bogotá S.A.S - Año: 2021', 0),
(27, 'Proceso Retiro', '../images/servicios/proceso_retiro/Proceso_Retiro_20220124_1149.webp', '../images/servicios/proceso_retiro/Proceso_Retiro_20220124_1149.jpeg', '2021-09-27 11:37:00', 1, '2022-01-24 11:49:54', 2, 1, 4, 12, NULL, 0, 'Foto: GyP Bogotá S.A.S - Año: 2022', 0),
